import React, { Component } from 'react'
import { Text, View , TextInput , StyleSheet } from 'react-native'

 class login extends Component {

    constructor(props){
        super(props)

        this.state = {
            name : 'salman' ,
            umur : ''
        }

        this.change = this.change.bind(this)
    }

    change(data){
        console.log(data)
    }

    render() {

        const {name , umur } = this.state 
        return (
            <View style={styles.container}>
                <Text>Nama Kalian {name}</Text>
                <TextInput defaultValue={this.state.name} placeholder="Username" onBlur={ this.change }  style={styles.input}></TextInput>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    container : {
        padding : 10 
    } ,

    input : {
        borderWidth : 1 , 
        backgroundColor : '#777' ,
        padding : 10 ,
        borderRadius : 8 
    }
})

export default login
